import Vue from 'vue'
import Vuex from 'vuex'
import book from './modules/book';
import { stat } from 'fs';
Vue.use(Vuex)

export default new Vuex.Store({
    modules:{
      book
    },
    state: {
      fileName:''
  },
  mutations: {
    'SET_FILENAME':(state,fileName)=>{
        state.fileName=fileName
    }
  },
  actions: {
     setFileName:({commit},newTest)=>{
      return commit('SET_FILENAME')
     }
  }
})
